I really appreciate all the love and support I have received after the last post I made. I Rode a bull last night at the @chasehawksmemorial  rodeo in Billings to split 2nd, 3rd, and 4th. Might be down low, but my name is back in the World Standings. Thank you everyone! 

@parkershangovertonic 
@montana.silversmiths 

#allglorytogod

Went to Oregon last weekend and got a great warm up for the @prcamontanacircuit Finals. Ready to roll now. See you in Great Falls, MT! 

@parkershangovertonic 
@montana.silversmiths 

#allglorytogod

Got my first bull down last night at the @prcamontanacircuit Finals for a second place finish. Two more to go! 

@parkershangovertonic 
