I got the victory at the Williston ND Xtreme Bulls event last night. But Unfortunately I paid the price for my dismount and got K.O.'d on my second bull to win it. The first time in my long career that I've been unable to get up in the arena. But after cussing the poor paramedics I got up shortly. I'm fine but sore obviously.  Rough night for me and a couple buddies. 

@montana.silversmiths 
@parkershangovertonic 

#godiseverything

Ended up winning the Redding California Xtreme Bulls last night on Shaved Ice. Needed that after getting my butt handed to me at the last couple of big ones. Spring Rodeos are my favorite for sure! 

@parkershangovertonic 
