Had a lot of people ask why I was not riding last night and tonight at the Circuit Finals. During the first round, I took a horn to the chest and back with a bit of force. This partially collapsed my left lung. It also broke one rib and chipped a couple of others. I am okay for now, but there's no world where I could ride a bull in this condition. Thank you for the support I have received! 

